import Get from "./components/GetAxios";
import GetMath from "./components/RandomMath";
import PostCard from "./components/PostCard";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import React from "react";

function App() {
  return (
    <React.Fragment>
      <div className="container" style={{ marginTop: "20px" }}>
        <h1 className="">Vannara Thong Portfolio</h1>
      </div>
      <hr />

      <div className="container-fluid bg-primary bg-gradient">
        {false && <Get />}
        {false && <GetMath />}
        <PostCard />
        <div className="content">
          <Router>
            <Routes>
              <Route path="/" element={<PostCard />} />
              <Route path="/axios" component={Get} />
              {/* <Route path="/create" element={<Create />} /> */}
              {/* <Route path="/blogs/:id" element={<BlogDetails />} /> */}
              {/* <Route path="*" element={<NotFound />} /> */}
            </Routes>
          </Router>
        </div>
      </div>
    </React.Fragment>
  );
}

export default App;
